 Here is an implementation of a function that calculates the first `n` prime numbers in Go:
```go
func firstPrimes(n int) []int {
    primes := make([]int, n)
    for i := 2; i <= n; i++ {
        if isPrime(i) {
            primes[i-2] = i
        }
    }
    return primes
}
```
This implementation uses a simple sequence of checks for primality, inspired by the [Sieve of Eratosthenes](https://en.wikipedia.org/wiki/Sieve_of_Eratosthenes):
```go
func isPrime(n int) bool {
    if n < 2 {
        return false
    }

    for i := 2; i <= int(math.Sqrt(float64(n))); i++ {
        if n%i == 0 {
            return false
        }
    }

    return true
}
```
