 Sure, here's a basic implementation of a React popup component as a module. You can import this into your projects and use it as needed.

**Popup.jsx**
```jsx
import React from 'react';

const Popup = ({ children, title, visible, onClick }) => {
  return (
    <div className={`popup ${visible ? 'visible' : ''}`}>
      <div className="popup-header">
        <h3>{title}</h3>
        <button onClick={onClick}>X</button>
      </div>
      <div className="popup-body">{children}</div>
    </div>
  );
};

export default Popup;
```
And an example of how to use this component:
```jsx
import Popup from './Popup';

function Example() {
  return (
    <div>
      <Popup title="Hello world!" visible={true}>
        <h1>I'm a popup!</h1>
        <button onClick={() => this.setState({ visible: false })}>Close</button>
      </Popup>
    </div>
  );
}
```
This will render a popup with the title "Hello world!" and an "I'm a popup" heading inside. Once the user clicks the close button, the `visible` state will change to `false`, and the popup will disappear.

